import React from "react";
import ReactDOM, { render } from "react-dom";
import "./index.scss";

class Header extends React.Component {
  render() {
    return (
      <nav className="header">
        <ul>
          <li>
            <a>Site name</a>
          </li>
        </ul>
      </nav>
    );
  }
}

class Content extends React.Component {
  render() {
    return (
      <div className="content">
        <Menu />
        <List />
      </div>
    );
  }
}

class Menu extends React.Component {
  render() {
    return (
      <div className="menu-container">
        <h1> Explore </h1>
        <h1> My work </h1>
        <h3> Notebooks</h3>
        <h3> Datasets</h3>
      </div>
    );
  }
}

class List extends React.Component {
  render() {
    return (
      <div className="list-container">
        <h1>Notebooks</h1>
        <ItemContainer />
        <ItemContainer />
        <ItemContainer />
      </div>
    )
  }
}

class ItemContainer extends React.Component {
  render() {
    return (
      <div className="list-item">
          <ItemContentsOne />
          <ItemContentsTwo />
      </div>
    )
  }
}

class ItemContentsOne extends React.Component {
  render() {
    return (
      <div className="item-contents-row-one">
        <h3>Adam's Notebook</h3>
        <button className="edit-button wrap">Edit</button>
      </div>
    )
  }
}

class ItemContentsTwo extends React.Component {
  render() {
    return (
      <div className="item-contents-row-two">
        <p>Last edited</p>
        <p>Yesterday</p>
      </div>
    )
  }
}

class Container extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <Content />
      </div>
    );
  }
}

ReactDOM.render(<Container />, document.getElementById("root"));
